const AddNewForm = () =>
{
    return (
        <div>
            <form>
                <input placeholder="Название"/>
                <input placeholder="Дата"/>
                <input placeholder="Время"/>
                <input placeholder="Место"/>
                <input placeholder="Описание"/>
                <button>Добавить</button>
            </form>
        </div>
    )
}

export default AddNewForm;
